import HeaderPage from "./HeaderPage"
import modelsback from "./teslaimg/modelS.jfif"
const ModelS = () => {
    return (
      <HeaderPage
         title="Model S"
         background={modelsback}
         description="Plaid"
         range="390mi"
         time="1.99s"
         speed="200mph"
         horsepower="1,020hp"
         first
      />
      
      );
}
 
export default ModelS;
